export default (function(a,b,c,d,e,f,g,h){return {data:{i0ScYENof1:{data:{id:414,attributes:{imdbId:"tt3901826",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMWM2MzQ4YTAtMTBkZS00ODA1LWFmNTEtMjEwNzk3ZGJiZDc3XkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.7\u002F10"},{Source:"Rotten Tomatoes",Value:"95%"},{Source:"Metacritic",Value:"78\u002F100"}],item_lang:{data:{id:1077,attributes:{title:d,plot:"From executive producer Angelina Jolie and the creators of the Academy Award nominated The Secret of Kells and Song of the Sea, comes the highly-anticipated new feature based on Deborah Ellis' bestselling novel. Parvana is an 11-year-old girl growing up under the Taliban in Afghanistan in 2001. When her father is wrongfully arrested, Parvana cuts off her hair and dresses like a boy in order to support her family. Working alongside her friend Shauzia, Parvana discovers a new world of freedom-and danger. With undaunted courage, Parvana draws strength from the fantastical stories she invents, as she embarks on a quest to find her father and reunite her family. Equal parts thrilling and enchanting, The Breadwinner is an inspiring and luminously animated tale about the power of stories to sustain hope and carry us through dark times.",slug:"the-breadwinner"}}},books:{data:[{id:3443,attributes:{title:d,description:g,thumbnail:h,authors:[a],firstBook:true,published:e,publisher:f,subtitle:b}},{id:3444,attributes:{title:"The Breadwinner Trilogy",description:"Three stories detail the lives of Parvana, who dresses as a boy in order to provide for her family, and Shauzia, who lives in a widow's compound and dreams of moving to France.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cO3ol59_HNYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2009-01-01",publisher:"Groundwood Books Ltd",subtitle:b}},{id:3445,attributes:{title:"Parvana",description:"Based closely on real life, this is the exciting and inspiring story of Parvana, a young girl growing up in Afghanistan, as she struggles to make a life for herself and her family under the harsh rule of the Taliban.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_6IOaMsXPXEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2002-01-01",publisher:"Allen & Unwin",subtitle:b}},{id:3446,attributes:{title:"Parvana's Journey",description:"In this sequel to \"The Breadwinner,\" the Taliban still control Afghanistan, but Kabul is in ruins. Twelve-year-old Parvana's father has just died, and Parvana sets out alone to find her family, masquerading as a boy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=c-wJq0tz6qMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:e,publisher:f,subtitle:b}},{id:3447,attributes:{title:d,description:g,thumbnail:h,authors:[a],firstBook:c,published:e,publisher:f,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940930234}}("Deborah Ellis","",null,"The Breadwinner","2004-03-04","Oxford University Press","Because the Taliban rulers of Kabul, Afghanistan impose strict limitations on women's freedom and behavior, eleven-year-old Parvana must disguise herself as a boy so that her family can survive after her father's arrest.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_fUA8BmYYEoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api"))